import React from 'react';

const Display = (props) => {
    return (
        props.receivedImg.length > 0 &&
        <div>
            <img src={props.receivedImg} alt="Cannot render"></img>
            <a href={props.receivedImg} download>Click here to download!</a>
        </div>
    )
}

export default Display
